RegisterCommand("imap_finder", function()
    for _, imap in next, IMAPS do
        RequestImap(imap)
    end
    local currentMin, currentMax = 1, #IMAPS
    local done = false
    local isOn = true
    local leftPrompt = BuildPrompt(TEXT("Visible"), `INPUT_FRONTEND_LEFT`)
    local rightPrompt = BuildPrompt(TEXT("Removed"), `INPUT_FRONTEND_RIGHT`)
    local quitPrompt = BuildPrompt(TEXT("Quit"), `INPUT_ENTER`)
    local currentMid = math.floor(currentMin + (currentMax - currentMin) / 2)
    local function DisableImapProcess()
        currentMid = math.floor(currentMin + (currentMax - currentMin) / 2)
        for idx = currentMin, currentMax do
            RequestImap(IMAPS[idx])
        end
        for idx = currentMin, currentMid do
            RemoveImap(IMAPS[idx])
        end
    end
    PromptSetVisible(leftPrompt, true)
    PromptSetVisible(rightPrompt, true)
    PromptSetEnabled(leftPrompt, true)
    PromptSetEnabled(rightPrompt, true)
    PromptSetEnabled(quitPrompt, true)
    PromptSetEnabled(quitPrompt, true)
    while not done do
        local _leftPress = PromptIsJustPressed(leftPrompt)
        local _rightPress = PromptIsJustPressed(rightPrompt)
        local _quitPress = PromptIsJustPressed(quitPrompt)
        local leftPress = _leftPress and _leftPress ~= 0
        local rightPress = _rightPress and _rightPress ~= 0
        local quitPress = _quitPress and _quitPress ~= 0
        if _leftPress then
            currentMin = currentMid
        elseif _rightPress then
            currentMax = currentMid
        end
        if _leftPress or _rightPress then
            if (currentMax - currentMin) == 0 then
                done = true
                print("RESULT: " .. IMAPS[currentMin])
                break
            end
            DisableImapProcess()
        end
        if quitPress then
            break
        end
        Wait(0)
    end
    PromptSetVisible(leftPrompt, false)
    PromptSetVisible(rightPrompt, false)
    PromptSetEnabled(leftPrompt, false)
    PromptSetEnabled(rightPrompt, false)
    PromptSetEnabled(quitPrompt, false)
    PromptSetEnabled(quitPrompt, false)
end)
